INSERT INTO `text_template` VALUES ('1', 'en', 'birthday', NULL, 'Every birthday is the beginning of a new life for you. On this special day, may you be surrounded by love and blessings, and may you continue to move forward and achieve more dreams in the new year. Happy birthday!', 0, '2024-04-25 13:03:48');
INSERT INTO `text_template` VALUES ('2', 'zh', 'birthday', NULL, '每年的生日都是你新生命的开始，在这个特别的日子里，愿你被爱和祝福所环绕，在新的一岁里继续前进，实现更多梦想。生日快乐！', 0, '2024-04-25 13:04:16');
INSERT INTO `text_template` VALUES ('3', 'en', 'birthday', NULL, 'May your birthday be as wonderful as the joy you bring, and as warm as the love you possess. Wishing you a happy birthday!', 0, '2024-04-25 13:04:48');
INSERT INTO `text_template` VALUES ('4', 'zh', 'birthday', NULL, '愿你的生日像你所带来的快乐一样美好，像你所拥有的爱一样温馨。祝你生日快乐！', 0, '2024-04-25 13:05:13');
